import React, { Component } from 'react';
import MainContainer from './ Component/MainContainer';
import ProjectsPanel from './ Component/ProjectsPanel';
import TeamsPanel from './ Component/TeamsPanel';
import EmployeesPanel from './ Component/EmployeesPanel';

class App extends Component {
  render() {
    return (
      <MainContainer>
              <h1 className="page-header">Overview</h1>
              <div className="row">
                <div className="col-md-4">
                  <ProjectsPanel />
                </div>
                <div className="col-md-4">
                  <TeamsPanel />
                </div>
                <div className="col-md-4">
                  <EmployeesPanel />
                </div>
              </div>
    </MainContainer>
    );
  }
}

export default App;
